import React from 'react';
import { Container } from 'react-bootstrap';
import NavbarTop from '../components/NavbarTop';
import NavbarButom from '../components/NavbarButom';

const TheBrigadeHero = () => {
  return (
    <div>
      <NavbarTop />
      {/* Skewed dark overlay */}
      <div
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          background: 'rgba(0, 0, 0, 0.4)',
          transform: 'skewY(-5deg)',
          transformOrigin: 'top left',
          zIndex: 1000,
          pointerEvents: 'none',
        }}
      />

      {/* Hero Section */}
      <Container
        fluid
        style={{
          backgroundImage: `url('https://img.freepik.com/premium-psd/model-actor-portfolio-landing-page_23-2149084292.jpg?ga=GA1.1.1831688669.1747417632&semt=ais_hybrid&w=740')`,
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          minHeight: '70vh',
          color: 'white',
          overflow: 'hidden',
          position: 'relative',
        }}
      >
        <div
          style={{
            position: 'relative',
            zIndex: 2,
            textAlign: 'end',
            paddingRight: '1rem',
          }}
          data-aos="flip-right"
        >
          <h1
            style={{
              textTransform: 'uppercase',
              fontFamily: 'Anton, sans-serif',
              lineHeight: 1.0,
              letterSpacing: '0em',
              fontSize: '9vw',
              fontWeight: 900,
              color: 'transparent',
              WebkitTextStroke: '2px grey',
              marginBottom: 0,
            }}
          >
            The<br />Brigade
          </h1>
        </div>

        <NavbarButom />
      </Container>
    </div>
  );
};

export default TheBrigadeHero;
